component.schema:
{
 "description": "Tunnel is the Schema for the tunnels API",
 "properties": {
  "spec": {
   "description": "TunnelSpec defines the desired state of Tunnel",
   "properties": {
    "exitServer": {
     "type": "string"
    },
    "tcp": {
     "properties": {
      "localPort": {
       "type": "integer"
      },
      "remotePort": {
       "type": "integer"
      },
      "serviceRef": {
       "properties": {
        "name": {
         "type": "string"
        },
        "namespace": {
         "type": "string"
        }
       },
       "required": [
        "name"
       ],
       "type": "object"
      }
     },
     "required": [
      "localPort",
      "remotePort",
      "serviceRef"
     ],
     "type": "object"
    },
    "transport": {
     "properties": {
      "bandwidthLimit": {
       "pattern": "^\\d+(KB|MB)$",
       "type": "string"
      },
      "proxyProtocol": {
       "enum": [
        "v1",
        "v2"
       ],
       "type": "string"
      },
      "useCompression": {
       "type": "boolean"
      },
      "useEncryption": {
       "type": "boolean"
      }
     },
     "required": [
      "useCompression",
      "useEncryption"
     ],
     "type": "object"
    }
   },
   "required": [
    "exitServer",
    "tcp",
    "transport"
   ],
   "type": "object"
  }
 },
 "title": "Tunnel",
 "type": "object"
}
